window.bookSummaryJSON = "<p>Vampire Cat Crawfield is experiencing a new role as a mother. Turns out, trying to manage a perfect domestic life for her daughter is more...challenging than Cat ever imagined. Since things have finally quieted down in the undead world, her husband, Bones, suggests that Cat recharge by spending a girls-only getaway with her best friend, Denise. </p> <p>Cat and Denise intend to spend the week doing nothing more than dancing, drinking, and sightseeing. Unfortunately, they stumble across a deadly summer solstice ritual performed by powerful witches who have no intention of letting their uninvited guests live to reveal what they saw. Will this girls-only getaway turn out to be the last vacation - ever! - for Cat and Denise? </p>"; 
